import React from 'react'
import {ListGroup, Form, Button} from 'react-bootstrap';
const List = () => {

  return (
    <ListGroup defaultActiveKey="#link1">
      <ListGroup.Item className='d-flex' active>
      <Form.Check className='me-3'
            type="checkbox"
            id={`default`}
          />
        Link 1
        <Button className='ms-auto' variant="danger" size="sm" >Sil</Button>
      </ListGroup.Item>
    
      <ListGroup.Item className='d-flex' >
      <Form.Check className='me-3'
            type="checkbox"
            id={`default`}
          />
        Link 1
        <Button className='ms-auto' variant="danger" size="sm" >Sil</Button>
      </ListGroup.Item>
    </ListGroup>
  );
  
};

export default List;
